import React, { Component } from 'react'; 
import { Label } from 'semantic-ui-react';

class ViewOrder extends Component {
  constructor(props) {
    super(props);
    this.state = {
      saladOrders: []
    };
    this.addOrder = this.addOrder.bind(this);
  }

  addOrder(event){
    event.preventDefault();
    this.setState({
      saladOrders:this.props.order
    })
  }

    render() {
      let saladOrder = Object.values(this.props.order);
      return (
    <div className="container">
        <div>
          <h4>{"Beställningar: "}</h4>
        </div>
        <div className="list-group">
         <ol>
             {saladOrder.map((item)=> item)}
        </ol>
        </div>  
        <div>
        <button type='button' className='btn btn-primary'> Skicka beställning</button>
        </div>
    </div>
      )
    }
}

export default ViewOrder;
